        }

        console.log(this.props.location.state);
    }



    render(){
        return(
            <div>
                id: {this.state.id}  <br/>
                boardEmail : {this.state.boardEmail} <br/>
                title : {this.state.title} <br/>
                content : {this.state.content} <br/>
                regDate : {this.state.regDate}
            </div>
        )
    }
}

export default BoardView;
